import styled from '@emotion/styled';
export const Container = styled.div`
  margin: 0 auto;
  padding-left: 16px;
  padding-right: 16px;
  @media (max-width: 767.98px) {
    width: 320px;
    padding-left: 20px;
    padding-right: 20px;
    margin: 0 auto;
  }
  @media (min-width: 768px) and (max-width: 1279.98px) {
    width: 768px;
    padding-left: 32px;
    padding-right: 32px;
  }
  @media (min-width: 1280px) {
    width: 1280px;
    padding-left: 16px;
    padding-right: 16px;
  }
`;
